import React from 'react';
import { Grid, Typography } from "@material-ui/core";

const Resume = () => {
    return (
        <>
            <Grid container>
                <Grid item>
                    <h5>Resume</h5>
                </Grid>
            </Grid>
        </>
    )
}

export default Resume
